import React from 'react';
import Navbar from './Navbar';
import { Switch, Route} from "react-router-dom";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Home from "./Home";


const App = () => {
    return (
        <>
        
        <Navbar />
        
        <Switch>
            <Route path="/" component={Home}/>
        </Switch>
        
        
        
            
        </>
    )
}

export default App;
